import Select from 'react-select';

const CustomSelectProps = (props) => {

  return (
    <>
        <Select
        options={[
            {value: 'fr', label: 'Français'},
            {value: 'en', label: 'English'}
        ]}
        className="selection-component"
        />
    </>
  );

};

export default CustomSelectProps;
